import React, { useState, useEffect } from "react";
import axios from "axios";

function App() {
  const [users, setUsers] = useState([]);
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [editingUser, setEditingUser] = useState(null);
  const [editForm, setEditForm] = useState({ name: "", email: "" });

  // ‚úÖ L·∫•y danh s√°ch ng∆∞·ªùi d√πng
  const fetchUsers = async () => {
    try {
      const res = await axios.get("http://localhost:5000/users"); // ƒë√∫ng endpoint backend
      setUsers(res.data);
    } catch (err) {
      console.error("‚ùå L·ªói khi t·∫£i danh s√°ch:", err);
    }
  };

  useEffect(() => {
    fetchUsers();
  }, []);

  // ‚úÖ Th√™m ng∆∞·ªùi d√πng
  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!name.trim()) {
      alert("‚ö†Ô∏è T√™n kh√¥ng ƒë∆∞·ª£c ƒë·ªÉ tr·ªëng!");
      return;
    }
    if (!/\S+@\S+\.\S+/.test(email)) {
      alert("‚ö†Ô∏è Email kh√¥ng h·ª£p l·ªá!");
      return;
    }

    try {
      await axios.post("http://localhost:5000/users", { name, email });
      setName("");
      setEmail("");
      fetchUsers();
    } catch (err) {
      console.error("‚ùå L·ªói khi th√™m ng∆∞·ªùi d√πng:", err);
    }
  };

  // ‚úÖ X√≥a ng∆∞·ªùi d√πng
  const handleDelete = async (id) => {
    if (window.confirm("B·∫°n c√≥ ch·∫Øc mu·ªën x√≥a ng∆∞·ªùi d√πng n√†y?")) {
      try {
        await axios.delete(`http://localhost:5000/users/${id}`);
        fetchUsers();
      } catch (err) {
        console.error("‚ùå L·ªói khi x√≥a:", err);
      }
    }
  };

  // ‚úÖ Ch·ªânh s·ª≠a ng∆∞·ªùi d√πng
  const handleEdit = (user) => {
    setEditingUser(user._id);
    setEditForm({ name: user.name, email: user.email });
  };

  const handleUpdate = async (id) => {
    if (!editForm.name.trim()) {
      alert("T√™n kh√¥ng ƒë∆∞·ª£c ƒë·ªÉ tr·ªëng!");
      return;
    }
    if (!/\S+@\S+\.\S+/.test(editForm.email)) {
      alert("Email kh√¥ng h·ª£p l·ªá!");
      return;
    }

    try {
      await axios.put(`http://localhost:5000/users/${id}`, editForm);
      setEditingUser(null);
      fetchUsers();
    } catch (err) {
      console.error("‚ùå L·ªói khi c·∫≠p nh·∫≠t:", err);
    }
  };

  return (
    <div style={{ padding: "30px", fontFamily: "Arial" }}>
      <h1>üìã Qu·∫£n l√Ω ng∆∞·ªùi d√πng</h1>

      {/* Form th√™m ng∆∞·ªùi d√πng */}
      <form onSubmit={handleSubmit} style={{ marginBottom: "20px" }}>
        <input
          type="text"
          placeholder="T√™n"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
        <input
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />
        <button type="submit">Th√™m</button>
      </form>

      <h2>Danh s√°ch ng∆∞·ªùi d√πng</h2>
      <ul>
        {users.map((u) => (
          <li key={u._id}>
            {editingUser === u._id ? (
              <>
                <input
                  type="text"
                  value={editForm.name}
                  onChange={(e) =>
                    setEditForm({ ...editForm, name: e.target.value })
                  }
                />
                <input
                  type="email"
                  value={editForm.email}
                  onChange={(e) =>
                    setEditForm({ ...editForm, email: e.target.value })
                  }
                />
                <button onClick={() => handleUpdate(u._id)}>üíæ L∆∞u</button>
                <button onClick={() => setEditingUser(null)}>‚ùå H·ªßy</button>
              </>
            ) : (
              <>
                {u.name} - {u.email}{" "}
                <button onClick={() => handleEdit(u)}>‚úèÔ∏è S·ª≠a</button>
                <button onClick={() => handleDelete(u._id)}>üóëÔ∏è X√≥a</button>
              </>
            )}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
